import React, { useState } from "react";

function GetMath() {
  const [state, setState] = useState(0);

  const getData = () => {
    let random = Math.floor(Math.random() * 10);
    setState(random);
  };

  return (
    <div>
      <button onClick={getData}>Get Data</button>
      {JSON.stringify(state)}
    </div>
  );
}

export default GetMath;
